import { useState, useRef, useEffect } from 'react'
import Cookies from 'js-cookie'
import { useNavigate } from "react-router-dom";
import ErrorPopUp from './ErrorPopUp';
import mojoFace from '../assets/mojo-face.png';
import { Link } from '.react-router-dom';

export default function Register({ user, setUser }) {
    const form = useRef()
    const navigate = useNavigate();
    const [isLoading, setIsLoading] = useState(false);

  const createUser = async (e) => {
    e.preventDefault();
    try {
      let formData = new FormData(form.current);
      let req = await fetch("http://localhost:3000/signup", {
        method: "POST",
        body: formData,
      });
      let res = await req.json();
      if (req.ok) {
        console.log(res.user);
        Cookies.set("token", res.token);
        setUser(res.user);
        navigate("/login");
        // setIsLoading(true);
      }
    } catch (error) {
      setIsLoading(false);
      alert("The email has been taken");
    }
  };

    // useEffect(() => {
    //     if (user) {
    //     setTimeout(() => {
    //         navigate("/home");
    //         setIsLoading(false);
    //     }, 3000);
    //     }
    // }, [user, navigate]);

    // if (isLoading) {
    //     return <Spinner />;
    //     }

    return(
        <>
        <section class="bg-gray-50 dark:bg-gray-900">
    <div class="flex flex-col items-center justify-center px-6 py-8 mx-auto md:h-screen lg:py-0">
        <div class="flex items-center mb-6 text-2xl font-semibold text-gray-900 dark:text-white">
          <img 
          class="w-8 h-8 mr-2" 
          src={mojoFace}
          alt="logo"/>
          Mojo Jojo Dojo    
        </div>
        <div class="w-full bg-white rounded-lg shadow dark:border md:mt-0 sm:max-w-md xl:p-0 dark:bg-gray-800 dark:border-gray-700">
            <div class="p-6 space-y-4 md:space-y-6 sm:p-8">
                <h1 class="text-xl font-bold leading-tight tracking-tight text-gray-900 md:text-2xl dark:text-white">
                    Create and account
                </h1>
            <form class="space-y-4 md:space-y-6" onSubmit={createUser} ref={form}>
                <div>
                <label for="email" class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Your email</label>
                    <input 
                    type="email" name="email" 
                    class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-purple-600 focus:border-purple-600 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-purple-500 dark:focus:border-purple-500" 
                    required=""
                    />
                </div>
                <div>
                    <label for="password" class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Password</label>
                    <input 
                    type="password" name="password" 
                    class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-purple-600 focus:border-purple-600 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-purple-500 dark:focus:border-purple-500" 
                    required=""
                    />
                </div>
                <div>
                    <label for="confirm-password" class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Confirm password</label>
                    <input 
                    type="confirm-password" name="confirm-password" 
                    class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-purple-600 focus:border-purple-600 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-purple-500 dark:focus:border-purple-500" 
                    required=""
                    />
                </div>
                <div class="flex items-start">
                    <div class="flex items-center h-5">
                    <input 
                        aria-describedby="terms" 
                        type="checkbox" 
                        class="w-4 h-4 border border-gray-300 rounded bg-gray-50 focus:ring-3 focus:ring-purple-300 dark:bg-gray-700 dark:border-gray-600 dark:focus:ring-purple-600 dark:ring-offset-gray-800" 
                        required=""/>
                    </div>
                    <div class="ml-3 text-sm">
                    <label for="terms" class="font-light text-gray-500 dark:text-gray-300">
                        I accept the 
                        <a class="font-medium text-purple-600 hover:underline dark:text-purple-500" 
                        href="#">
                            Terms and Conditions
                            </a>
                        </label>
                    </div>
                </div>
                    <button type="submit" class="w-full text-white bg-purple-600 hover:bg-purple-700 focus:ring-4 focus:outline-none focus:ring-purple-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-purple-600 dark:hover:bg-purple-700 dark:focus:ring-purple-800">Create an account</button>
                    <p class="text-sm font-light text-gray-500 dark:text-gray-400">
                        Already have an account? 
                        <Link to="/login" class="font-medium text-purple-600 hover:underline dark:text-purple-500">
                        Login here
                        </Link>
                    </p>
                </form>
            </div>
        </div>
    </div>
    </section>
        </>
    )
}
